import React, { Component } from 'react';
import { Header, Footer } from './Layouts';
import Exercises from './Exercises';

class App extends Component {
    render() {
        return (
            <>
                <Header />
                <Exercises />
                <div>Hello</div>
                <Footer />
            </>
        );
    }
}

export default App;
